import React, { useState } from 'react';




function Todo(props) {

    return (
        <div className='todo'>
            <li className='todo-item'>5555</li>
            <button className='complete-btn'>
                <i className='fas fa-check'></i>
                </button>
            <button className='trash-btn' >
                <i className='fas fa-check'></i>
                </button>

        </div>
    );
};
export default Todo;
